import React from "react";
//import { withRouter } from 'react-router-dom';
import { Nav, Navbar, Link, NavDropdown, Button, Form, FormControl, NavItem } from 'react-bootstrap'

import "../navigation/navigation.css";
import '../../../node_modules/bootstrap/dist/css/bootstrap.min.css'
import { Container } from "react-bootstrap/lib/Tab";

export class CommunicatorNavigation extends React.Component {
  render() {
    return (
      <Container>
        <Navbar expand="sm" className="navbar navbar-inverse menu-background sht-navbar">
          <Nav className="mr-auto">
            <NavItem href="/default">Home</NavItem>
            <NavItem href="#">Features</NavItem>
            <NavItem href="#">Pricing</NavItem>
          </Nav>
        </Navbar>
      </Container>
    )
  }
}
